import React from 'react';
import { GluestackUIProvider, Box, VStack } from '@gluestack-ui/themed';

import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import configuracion_usuario from './configuracion_usuario';
import carrito from './Carrito';
import cuenta from './cuenta';
import Productos from './Productos';
import { View, Text } from 'react-native';
import login from './login';
import Crear_Usuario from './Crear_Usuario';

import { createNativeStackNavigator } from '@react-navigation/native-stack';

const Tab = createBottomTabNavigator();

function Inicio(){
return( 
<Tab.Navigator>
<Tab.Screen name="Productos" component={Productos} />
<Tab.Screen name="Carrito" component={carrito} />
<Tab.Screen name="Cuenta" component={cuenta}/> 
<Tab.Screen name="login" component={login}/>
<Tab.Screen name="Crear" component={Crear_Usuario}/>
</Tab.Navigator> 

)
};

export default Inicio

function useTheme(): { isDarkMode: any; } {
    throw new Error('Function not implemented.');
}
